import './Header.css';
import { Routes, Route, Link } from 'react-router-dom';

function Header() {
  return (
    <header className='header'>
      <button className='header__logo'></button>
      <nav className='header__navbar'>
        <Routes>
          <Route
            path='/'
            element={
              <>
                <Link className='header__link' to='/signup'>
                <button className='header__nav-button header__nav-button_type_signup'>Регистрация</button>
                  
                </Link>
                <Link className='header__link' to='/signin'>
                  <button className='header__nav-button header__nav-button_type_signin'>Войти</button>
                </Link>
              </>
            }
          />
        </Routes>
      </nav>
    </header>
  );
}

export default Header;
